""" Module contains a dummy unit test that always passes.
"""
import unittest
import numpy as np
import porepy as pp
import pygeon as pg


class DifferentialsMDGUnitTest(unittest.TestCase):
    def test_2d_simplicial_1_fracture(self):
        mesh_args = {"mesh_size_frac": 0.125}
        x_endpoints = [0, 0.5]
        mdg, _ = pp.md_grids_2d.single_horizontal(mesh_args, x_endpoints, simplex=True)
        pg.convert_from_pp(mdg)
        mdg.compute_geometry()

        div = pg.div(mdg)
        curl = pg.curl(mdg)
        grad = pg.grad(mdg)

        known_div, known_curl, known_grad = self._test_2d_simplicial_1_fracture()

        self.assertTrue(np.sum(curl @ grad) == 0)
        self.assertTrue(np.sum(div @ curl) == 0)

        self.assertTrue(np.allclose(div.todense(), known_div))
        self.assertTrue(np.allclose(curl.todense(), known_curl))
        self.assertTrue(np.allclose(grad.todense(), known_grad))

